import Mdc from './componentes/Mdc';
import Nota from './componentes/Nota';
import Primo from './componentes/Primo';

function App() {
  return (
    <div>
      <h1>Calcular nota:</h1>
      <p>Insira as notas e clique no botão para calcular:</p>
      <Nota />
      <h1>Calcular MDC:</h1>
      <Mdc/>
      <h1>Verificar se o número é primo: </h1>
      <Primo/>

    </div>
  );
}

export default App;
